/**
 * @description
 *
 * Interface para o método `getLiterals()` do serviço ThfI18nService.
 *
 * @usedBy ThfI18nService
 */
export interface ThfI18nLiterals {
    /** Contexto utilizado na busca das literais. */
    context?: string;
    /** Idioma a ser buscado. */
    language?: string;
    /** Lista das literais. */
    literals?: Array<string>;
}
